import React, { Component } from 'react';


class HeroItems extends Component {

    render() {
        return (
            <div className="hero-items__container">
                {this.props.items.map((img, index) =>
                    <img key={`hero-items-${index}`} src={img.src}/>
                )}
            </div>
        );
    }
}

export default HeroItems;
